import React from 'react';
import ReactDOM from 'react-dom';

  const course = 'Half Stack application development'
  const part1 = {
	name: 'Fundamentals of React',
        exercises: 10
  }
  const part2 = {
	name: 'Using props to pass data',
 	exercises: 7
  }
  const part3 = {
	name: 'State of a component',
	exercises: 14
  }

const App = () => {
	return [
		<Header 
			course={course} 
		/>,
		<Content 
			part1={part1} 
			part2={part2} 
			part3={part3} 
		/>,
		<Total 
			part1={part1} 
			part2={part2} 
			part3={part3}  
		/>,
	]
}

const Header = (props) => {
	return (
      		<h1>{props.course}</h1>
	)
}

const Content = (props) => {
	return (
		<div>
			<Part part={part1} />
			<Part part={part2} />
			<Part part={part3} />
		</div>
	)
}

const Part = (props) => {
	return (
		<div>
			<p>
				{props.part.name} {props.part.exercises}
			</p>
		</div>
	)
}

const Total = (props) =>  {
	return (
		<p>
			Number of exercises {
				props.part1.exercises + 
				props.part2.exercises + 
				props.part3.exercises
			}
		</p>
	)
}

ReactDOM.render(<App />, document.getElementById('root'))
